" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Overview of treatment for inguinal and femoral hernias",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?28/20/29000/contributors\">",
"     Author",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?28/20/29000/contributors\">",
"     David C Brooks, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?28/20/29000/contributors\">",
"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?28/20/29000/contributors\">",
"     Richard Turnage, MD",
"    </a>",
"    <br/>",
"   </div>",
